import React from 'react'
import './Calculadora.css'
import Button from './Boton'
channel.send
class Home extends React.Component {
    render() {
        return (
            <div id="calculadora">
                <Button/>
                <Button/>
                <Button/>
            </div>
        )
    }
}


export default Home;
